import './App.css';
import { Header } from './Header';
import { BrowserRouter,Route ,} from 'react-router-dom';
import { Routes } from 'react-router-dom';
import { Login } from './Login';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
       <Header />
      <Routes>

          <Route index element={<Login />} />

      </Routes>


      </BrowserRouter>

    </div>
  );
}

export default App;
